import { NgModule } from '@angular/core';
import { UserInfoComponent } from "./UserInfoComponent";
import { HttpClientModule } from '@angular/common/http';

@NgModule({
  declarations: [
    UserInfoComponent    
  ],
  imports: [
    HttpClientModule
  ],
  exports: [UserInfoComponent]
})
export class UserInfoModule { }
